import '../App.css';
// import  { Component } from 'react';
import './aboutme.css'



function Skills() {
	return (
		<div>
			<div className="aboutme__container"> </div>
			<h2>I am proficient in</h2>
			<p>HTML, CSS,  SASS, Javascript,  Figma, Git, React, Wordpress	</p>
			<h2>Familaiar with </h2>
			<p>PHP, Mysql, Ajax, Linux, Webpack </p>
			<h2>Exploring</h2>
			<p>Typescript, Graphql, Material UI</p>
		</div>
	)
}



export default Skills
